# Directory to save downloaded files
SAVE_DIR = "downloads"

# Ensure the save directory exists
os.makedirs(SAVE_DIR, exist_ok=True)

# Function to download files
def download_mp3(url, save_dir):
    try:
        # Extract the file name from the URL
        file_name = url.split("/")[-1]
        file_path = os.path.join(save_dir, file_name)

        # print(f"Downloading {file_name}...")
        
        # Request the file
        response = requests.get("http://tromboneexcerpts.org/redirectFiles.php?file=" + url, stream=True)
        response.raise_for_status()  # Raise an exception for HTTP errors

        # Save the file
        with open(file_path, "wb") as file:
            for chunk in response.iter_content(chunk_size=1024):
                file.write(chunk)

        # print(f"Saved: {file_path}")

    except requests.exceptions.RequestException as e:
        print(f"Failed to download {url}: {e}")

# Iterate over the URLs and download each MP3
for idx, piece in enumerate(mp3_urls):
    print(f"Downloading piece {idx + 1}/{len(mp3_urls)}...")
    for url in piece:
        download_mp3(url, SAVE_DIR)
